How to fetch related user info when fetching all posts in MongoDB<p>Hello I am new to MongoDB. I want to fetch all posts with user details of who created the post. I have two collections.</p>
<p>users collection:</p>
<pre><code>[{
   &quot;_id&quot;: {
     &quot;$oid&quot;: &quot;655d897b794e33f8ae0e2377&quot;
   },
   &quot;name&quot;: &quot;kunal&quot;,
 },
 {
   &quot;_id&quot;: {
     &quot;$oid&quot;: &quot;655d897b794e33f8ae0e237b&quot;
   },
   &quot;name&quot;: &quot;Amit&quot;,
 }]
</code></pre>
<p>user_posts collection</p>
<pre><code>[{
    &quot;_id&quot;: {
      &quot;$oid&quot;: &quot;655d897b794e33f8ae0e2378&quot;
    },
    &quot;user_id&quot;: &quot;655d897b794e33f8ae0e2377&quot;,
    &quot;post_name&quot;: &quot;Test Post Group&quot;,
  },
  {
    &quot;_id&quot;: {
      &quot;$oid&quot;: &quot;655d897b794e33f8ae0e2379&quot;
    },
    &quot;user_id&quot;: &quot;655d897b794e33f8ae0e2377&quot;,
    &quot;post_name&quot;: &quot;Test Post Group&quot;,
  },
  {
    &quot;_id&quot;: {
      &quot;$oid&quot;: &quot;655d897b794e33f8ae0e237a&quot;
    },
    &quot;user_id&quot;: &quot;655d897b794e33f8ae0e2377&quot;,
    &quot;post_name&quot;: &quot;Test Post 3&quot;,

  },
  {
    &quot;_id&quot;: {
      &quot;$oid&quot;: &quot;655d897b794e33f8ae0e237c&quot;
    },
    &quot;user_id&quot;: &quot;655d897b794e33f8ae0e237b&quot;,
    &quot;post_name&quot;: &quot;Test Post Amit&quot;,
  }]
</code></pre>
<p>In the users collection, <code>_id</code> is an <code>ObjectId</code> but in the user_posts collection, <code>user_id</code> is not an <code>ObjectId</code>. But I don't want to make <code>user_id</code> as <code>ObjectId</code>.</p>
<p>I tried below query:</p>
<pre><code>db.user_posts.aggregate([
  {
    '$lookup' : {
      'as' : 'user_info',
      'from' : 'users',
      'foreignField' : '_id',
      'localField' : 'user_id'
    }
  }
]).pretty();
</code></pre>
<p>Output:</p>
<pre><code>[
  {
    &quot;_id&quot;: ObjectId(&quot;655c3285822c4a52150c30a8&quot;),
    &quot;post_name&quot;: &quot;Test Post&quot;,
    &quot;user_id&quot;: &quot;655c3285822c4a52150c30a7&quot;,
    &quot;user_info&quot;: []
  },
  {
    &quot;_id&quot;: ObjectId(&quot;655c3285822c4a52150c30a9&quot;),
    &quot;post_name&quot;: &quot;Test Post 2&quot;,
    &quot;user_id&quot;: &quot;655c3285822c4a52150c30a7&quot;,
    &quot;user_info&quot;: []
  },
  {
    &quot;_id&quot;: ObjectId(&quot;655c3285822c4a52150c30aa&quot;),
    &quot;post_name&quot;: &quot;Test Post 3&quot;,
    &quot;user_id&quot;: &quot;655c3285822c4a52150c30a7&quot;,
    &quot;user_info&quot;: []
  }
]
</code></pre>
<p>This above query only works if makes <code>user_id</code> as an <code>ObjectId</code> at the schema level. May be needed to convert <code>user_id</code> to an <code>ObjectId</code> in the run-time query itself. Can anyone help me to solve this issue?</p>
<p><a href="https://mongoplayground.net/p/qPQGN2VCH8-" rel="nofollow noreferrer">https://mongoplayground.net/p/qPQGN2VCH8-</a></p>

