Embed Field: Why does next.js need runtime environment variables at build?<p>After a bunch of false starts I've followed the <a href="https://create.t3.gg/" rel="nofollow noreferrer">T3 stack</a> approach to runtime <a href="https://create.t3.gg/en/usage/env-variables" rel="nofollow noreferrer">environment variables</a> for my next.js app, particularly to protect my <code>MONGODB_URI</code> secret by providing it only at runtime on the server.</p>
<p>env/server.js:</p>
<pre class="lang-js prettyprint-override"><code>import { createEnv } from &quot;@t3-oss/env-nextjs&quot;;
import { z } from &quot;zod&quot;;

export const env = createEnv({
  server: {
    NODE_ENV: z.enum([&quot;development&quot;, &quot;test&quot;, &quot;production&quot;]),
    MONGODB_URI: z.string().url(),
  },
  runtimeEnv: process.env,
});
</code></pre>
<p>lib/mongodb.ts:</p>
<pre><code>import { MongoClient } from &quot;mongodb&quot;;
import { env } from &quot;@/env/server.mjs&quot;;

const uri = env.MONGODB_URI;
const options = {};

if (!uri) {
  throw new Error('Invalid/Missing environment variable: &quot;MONGODB_URI&quot;');
}

let client;
let clientPromise: Promise&lt;MongoClient&gt;;

client = new MongoClient(uri, options);
clientPromise = client.connect();
export default clientPromise;

</code></pre>
<p>api/data/route.ts:</p>
<pre class="lang-js prettyprint-override"><code>import clientPromise from &quot;@/lib/mongodb&quot;;

export async function GET() {
  const client = await clientPromise;
  const db = client.db();

  const data = await db
    .collection(&quot;data&quot;)
    .find({})
    .toArray();

  return Response.json({
    type: &quot;FeatureCollection&quot;,
    features: data,
  });
}
</code></pre>
<p>That works locally, but causes a failure within the CI environment, because I've not defined the <code>MONGODB_URI</code> environment variable:</p>
<pre><code>$ next build
 Invalid environment variables: { MONGODB_URI: [ 'Required' ] }
  Failed to load next.config.mjs, see more info here https://nextjs.org/docs/messages/next-config-error
&gt; Build error occurred
</code></pre>
<p>I thought it would only be needed at runtime, not build. I can work around that by putting a dummy <code>MONGODB_URI</code> in <code>.env.production</code>, initially blank, but then looking like a dummy URL to satisfy the <code>zod</code> rule:</p>
<pre><code>MONGODB_URI=mongodb+srv://host.placeholder.com/db
</code></pre>
<p>That works better, but still fails to build locally:</p>
<pre><code>$ yarn run build
yarn run v1.22.19
$ next build
    Next.js 14.0.1
   - Environments: .env.production

  Creating an optimized production build
  Compiled successfully
  Linting and checking validity of types
   Collecting page data  ...Error: querySrv ENOTFOUND _mongodb._tcp.host.placeholder.com
    at QueryReqWrap.onresolve [as oncomplete] (node:internal/dns/promises:251:17) {
  errno: undefined,
  code: 'ENOTFOUND',
  syscall: 'querySrv',
  hostname: '_mongodb._tcp.host.placeholder.com'
}
  Collecting page data
   Generating static pages (0/7)  [=   ]
Error occurred prerendering page &quot;/api/data&quot;. Read more: https://nextjs.org/docs/messages/prerender-error
Error: querySrv ENOTFOUND _mongodb._tcp.host.placeholder.com
    at QueryReqWrap.onresolve [as oncomplete] (node:internal/dns/promises:251:17)
  Generating static pages (7/7)

&gt; Export encountered errors on following paths:
        /api/data/route: /api/data
error Command failed with exit code 1.
info Visit https://yarnpkg.com/en/docs/cli/run for documentation about this command.
</code></pre>
<p>Why are what should be server-only dynamic elements being prerendered at build? Why is Mongo trying to make a connection at build time? (Presumably because of the pre-render). Why are my runtime secrets needed for build? It seems like they're being baked in, and won't be overridden by the actual environment.</p>
<p>I'd rather not expose these on my CI environment if I don't have to. Do I really need to?</p>; Answer: For the first question, yes, it is. But it will check the if's behind the if entered. I mean, if the condition checked is the second, only the third will be checked with the new value. The second question is correct. When the while loop is not true, it will be out. You could have a print with 'Bingo' out of while true, because the only way to exit the while true is an except (code not continue) or while true exit.

