    @InjectConnection() private readonly connection: Connection,
  ) {}
}

async delete(idPa: string): Promise&lt;boolean&gt; {
 let result = false;
 const session = await this.connection.startSession();

 try {
      await session.withTransaction(async () =&gt; {
        await this.userModel.findOneAndUpdate(
          { _id: idPa },
          { status: false },
          { session },
        );
      });

      result = true;
    } finally {
      await session.endSession();
    }
}
</code></pre>
<p>As a result when running my service from the controller I get: <strong>MongoServerError: Transaction numbers are only allowed on a replica set member or mongos.</strong></p>

